import "../details.component/pubg.details.css";
import uc from "../../Images/pubgcard.jpg";
const UC = [
    { id: 1, className: "apple-card-1", image: apple },
    { id: 2, className: "apple-card-2", image: apple },
    { id: 3, className: "apple-card-3", image: apple },
    { id: 4, className: "apple-card-4", image: apple },
  ];
export function Pubgdetails() {
  return (
    <>
      <div className="container-details">
        <div className="head-rec">
          <p>PUBG 325 UC PINS (Global)</p>
        </div>
        <div className="pubgcard">
        {UC.map((uc) => (
          <div key={uc.id} className={uc.className}>
            <img src={uc.image} alt="uc" />
          </div>
        ))}
        </div>
      </div>
    </>
  );
}
